import React, { useEffect, useState } from 'react';
import { makeStyles } from '@material-ui/core/styles';
import { postService } from './../../services/post.service';
import { Post } from '../../components/post/Post';
import axios from 'axios';
import { authHeader } from '../../helpers/auth-header';
import { GridList, GridListTile } from '@material-ui/core';
const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
        flexWrap: 'wrap',
        justifyContent: 'space-around',
        overflow: 'hidden',
        backgroundColor: theme.palette.background.paper,
    },
    gridList: {
        width: 500,
        height: 450,
    },
}));
export function ImgOfUser(props) {
    const classes = useStyles();
    const idUser = props.idUser;
    const [img, setImg] = useState([])
    useEffect(() => {
        axios.get('http://localhost:8000/api/users/getImageOfUser/image', { headers: authHeader() })
            .then((result) => {
                setImg(result.data.restaurant);
            })
    }, []);
    return (
        <div className={classes.root}>
            <GridList className={classes.gridList} >
                {
                    img.length? img.forEach((ele) => {
                        ele.photo.forEach(element => {
                            console.log(element)
                            return <GridListTile key={element}>
                                <img src={element} alt={element} />
                            </GridListTile>
                        })
                    }) : ''
                }
            </GridList>
        </div>
    );
}
